import React, { useState, useEffect } from 'react';
import './App.css';



function LogTable() {
  const [logData, setLogData] =  useState((JSON.parse(localStorage.getItem('logData'))) || []);
  const [input1, setInput1] = useState('');
  const [selectedOption, setSelectedOption] = useState('');
  const [input3, setInput3] = useState('');
  const [input4, setInput4] = useState('');
  const [datetime, setDatetime] = useState('');
  const [input6, setInput6] = useState('');
  const [input7, setInput7] = useState('');
  const [input8, setInput8] = useState('');

  // useEffect(() => {
  //   const storedData = localStorage.getItem('logData');
  //   if (storedData) {
  //     setLogData(JSON.parse(storedData));
  //   }
  // }, []);

  useEffect(() => {
    localStorage.setItem('logData', JSON.stringify(logData));
  }, [logData]);

  const handleInput1Change = (event) => {
    setInput1(event.target.value);
  };

  const handleSelectChange = (event) => {
    setSelectedOption(event.target.value);
  };

  const handleInput3Change = (event) => {
    setInput3(event.target.value);
  };
  const handleInput4Change = (event) => {
    setInput4(event.target.value);
  };

  const handleDatetimeChange = (event) => {
    setDatetime(event.target.value);
  };

  const handleInput6Change = (event) => {
    setInput6(event.target.value);
  };

  const handleInput7Change = (event) => {
    setInput7(event.target.value);
  };
  const handleInput8Change = (event) => {
    setInput8(event.target.value);
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    setLogData([...logData, { input1, selectedOption, input3, input4, datetime, input6, input7, input8  }]);
    setInput1('');
    setSelectedOption('');
    setInput3('');
    setInput4('');
    setDatetime('');
    setInput6('');
    setInput7('');
    setInput8('');


  };

  const handleDeleteAll = () => {
    setLogData([]);
    localStorage.removeItem('logData');
  };

  return (
    <table className="log-table">
      <thead>
        <tr>
          <th><img src='https://png.pngtree.com/png-clipart/20210718/original/pngtree-multi-colour-calendar-2022-png-image_6538236.jpg'></img>Date / morning</th>
          <th><img src="https://png.pngtree.com/element_our/20200610/ourmid/pngtree-yesno-image_2239467.jpg" alt=""></img>Yes / No</th>
          <th><img src='https://img.freepik.com/free-vector/diagram-showing-pain-scale-level-with-different-colors_1308-70492.jpg?w=900&t=st=1670429540~exp=1670430140~hmac=9dd03cdd93ad28e1bacb98930ca3c1db0841388d9b0b38998457728365c11ac0'></img>level</th>
          <th><img src='https://img.freepik.com/free-vector/flat-design-spiral-book-mockup_23-2149567582.jpg?w=740&t=st=1670429604~exp=1670430204~hmac=51adac5256b716ee92bd0a7e8bcc31454f45617394e4fc2c8b881f46c76a7460'></img>Log</th>
          <th><img src='https://img.freepik.com/free-photo/beautiful-sunset-beach-landscape-with-boat_1112-212.jpg?w=1380&t=st=1670429697~exp=1670430297~hmac=cb6dd2bc528ce55455d8f3cb4c3416a279cf97ceafaab5b3242a507e2c3175d6'></img>Evening</th>
          <th><img src='https://png.pngtree.com/element_our/20200610/ourmid/pngtree-yesno-image_2239467.jpg'></img>Yes / No</th>
          <th><img src='https://img.freepik.com/free-vector/diagram-showing-pain-scale-level-with-different-colors_1308-70492.jpg?w=900&t=st=1670429540~exp=1670430140~hmac=9dd03cdd93ad28e1bacb98930ca3c1db0841388d9b0b38998457728365c11ac0'></img>level</th>
          <th><img src='https://img.freepik.com/free-vector/flat-design-spiral-book-mockup_23-2149567582.jpg?w=740&t=st=1670429604~exp=1670430204~hmac=51adac5256b716ee92bd0a7e8bcc31454f45617394e4fc2c8b881f46c76a7460'></img>Log</th>
        </tr>
      </thead>
      <tbody>
        {logData.map((item, index) => (
          <tr key={index}>
            <td>{item.input1}</td>
            <td>{item.selectedOption}</td>
            <td>{item.input3}</td>
            <td>{item.input4}</td>
            <td>{item.datetime}</td>
            <td>{item.input6}</td>
            <td>{item.input7}</td>
            <td>{item.input8}</td>
          </tr>
        ))}
        <td className="delete-all">
            <button onClick={handleSubmit}>Add</button>
          </td>
          <td>
            <button onClick={handleDeleteAll}>Delete All</button>
          </td>
      </tbody>
      <tfoot>
        <tr>
          <td>
            <input
              type="date"
              value={input1}
              onChange={handleInput1Change}

            />
          </td>
          <td>
              <select value={selectedOption} onChange={handleSelectChange}>
                <option value="">Select Option</option>
                <option value="Option 1">Option 1</option>
                <option value="Option 2">Option 2</option>
                <option value="Option 3">Option 3</option>
              </select>
            </td>
          <td>
            <input
              type="number"
              value={input3}
              onChange={handleInput3Change}
              placeholder="Level:"
            />
          </td>
          <td>
            <input
              type="text"
              value={input4}
              onChange={handleInput4Change}
              placeholder="Log:"
            />
          </td>
          <td>
            <input
              type="datetime-local"
              value={datetime}
              onChange={handleDatetimeChange}
            />
          </td>
          <td>
            <input
              type="text"
              value={input6}
              onChange={handleInput6Change}
              placeholder="Enter: Yes / No"
            />
          </td>
          <td>
            <input
              type="number"
              value={input7}
              onChange={handleInput7Change}
              placeholder="Level:"
            />
          </td>
          <td>
            <input
              type="text"
              value={input8}
              onChange={handleInput8Change}
              placeholder="Log:"
            />
          </td>

        </tr>
      </tfoot>
    </table>
  );

}

export default LogTable;
